import PropTypes from 'prop-types';
import { Component } from 'react';
import Page from '../components/Page';


export default function MyApp({ Component, pageProps }) {
  return (
    <Page>
      <Component {...pageProps} />
    </Page>
  );
}

Page.propTypes = {
  Component: PropTypes.Component,
  pageProps: PropTypes.any,
};
